import React, {useState} from 'react'

const Test1 = () => {

    let [color1, setColor1] = useState("gray");

    let demo1 = ()=>{
        setColor1("green");
    }
  return (
    <>
    <div className="container my-4">
        <div className="row">
            <div className="col-md-12">
                <button onClick={ demo1 } className='btn btn-success'>Green</button>
                <button onClick={ demo1 } className='btn btn-primary'>Blue</button>
                <button onClick={ demo1 } className='btn btn-danger'>Red</button>
                <div style={{ height : "200px", width : "200px", backgroundColor : color1 }}></div>
            </div>
        </div>
    </div>
    </>
  )
}

export default Test1
